import ExpenseItem from "./ExpenseItem"

const ExpenseList=(props)=>{
    return(
        <div>
            {props.expenses.map((ob)=>{
                return <ExpenseItem date={ob.date} amount={ob.amount} title={o}></ExpenseItem>
            })}
        </div>
    )
}
